INSERT INTO `employees` VALUES (1,'Ms.','15900000_1344482901.png','Davolio','Nancy','Sales Representative','1988-12-08','2013-05-01','507 - 20th Ave. E.\r\nApt. 2A','Seattle','WA','98122','United States','(206) 555-9857','5467','Education includes a BA in psychology from Colorado State University in 1970.  She also completed \"The Art of the Cold Call.\"  Nancy is a member of Toastmasters International.',2,203500.63,31),(2,'Dr.','52208200_1344482960.png','Fuller','Andrew','Vice President, Sales','1992-02-19','2014-08-14','908 W. Capital Way','Tacoma','WA','98401','United States','(206) 555-9482','3457','Andrew received his BTS commercial in 1974 and a Ph.D. in international marketing from the University of Dallas in 1981.  He is fluent in French and Italian and reads German.  He joined the company as a sales representative, was promoted to sales manager in January 1992 and to vice president of sales in March 1993.\n\nAndrew is a member of the Sales Management Roundtable, the Seattle Chamber of Commerce, and the Pacific Rim Importers Association.',2,177738.71,28),(3,'Ms.','09670100_1344483084.png','Leverling','Janet','Sales Representative','1993-08-30','2015-04-01','722 Moss Bay Blvd.','Kirkland','WA','98033','United States','(206) 555-3412','3355','Janet has a BS degree in chemistry from Boston College (1984).  She has also completed a certificate program in food retailing management.  Janet was hired as a sales associate in 1991 and promoted to sales representative in February 1992.',2,213035.35,26),(4,'Mrs.','80816900_1344483130.png','Peacock','Margaret','Sales Representative','1977-09-19','2014-05-03','4110 Old Redmond Rd.','Redmond','WA','98052','United States','(206) 555-8122','5176','Margaret holds a BA in English literature from Concordia College (1958) and an MA from the American Institute of Culinary Arts (1966).  She was assigned to the London office temporarily from July through November 1992.',2,250161.70,42),(5,'Mr.','86692900_1344482675.png','Buchanan','Steven','Sales Manager','1995-03-04','2016-10-17','14 Garrett Hill','London',NULL,'SW1 8JR','United Kingdom','(71) 555-4848','3453','Steven Buchanan graduated from St. Andrews University, Scotland, with a BSC degree in 1976.  Upon joining the company as a sales representative in 1992, he spent 6 months in an orientation program at the Seattle office and then returned to his permanent post in London.  He was promoted to sales manager in March 1993.  Mr. Buchanan has completed the courses \"Successful Telemarketing\" and \"International Sales Management.\"  He is fluent in French.\r\n',2,75559.95,25),(6,'Mr.','32285300_1344483161.png','Suyama','Michael','Sales Representative','1993-07-02','2020-10-17','Coventry House\r\nMiner Rd.','London',NULL,'EC2 7JR','United Kingdom','(71) 555-7773','428','Michael is a graduate of Sussex University (MA, economics, 1983) and the University of California at Los Angeles (MBA, marketing, 1986).  He has also taken the courses \"Multi-Cultural Selling\" and \"Time Management for the Sales Professional.\"  He is fluent in Japanese and can read and write French, Portuguese, and Spanish.',5,78188.95,26),(7,'Mr.','58648600_1344483057.png','King','Robert','Sales Representative','1999-05-29','2015-01-02','Edgeham Hollow\r\nWinchester Way','London',NULL,'RG1 9SP','United Kingdom','(71) 555-5598','465','Robert King served in the Peace Corps and traveled extensively before completing his degree in English at the University of Michigan in 1992, the year he joined the company.  After completing a course entitled \"Selling in Europe,\" he was transferred to the London office in March 1993.',5,141283.04,20),(8,'Ms.','13782300_1344483007.png','Callahan','Laura','Inside Sales Coordinator','1998-01-09','2015-03-05','4726 - 11th Ave. N.E.','Seattle','WA','98105','United States','(206) 555-1189','2344','Laura received a BA in psychology from the University of Washington.  She has also completed a course in business French.  She reads and writes French.',2,133286.43,22),(9,'Ms.','39342100_1344482860.png','Dodsworth','Anne','Sales Representative','1996-01-27','2015-11-15','7 Houndstooth Rd.','London',NULL,'WG2 7LT','United Kingdom','(71) 555-4444','452','Anne has a BA degree in English from St. Lawrence College.  She is fluent in French and German.',5,82956.70,24);
